drop database if exists OnlineMeds;
create database OnlineMeds;
use OnlineMeds;
create table Company(
Company_ID INT NOT NULL,
Company_Name VARCHAR(50) NOT NULL,
primary key(Company_ID)
);


create table Medicine(
Serial_num INT NOT NULL ,
Brand_Name VARCHAR(50) NOT NULL,
Generic_Name VARCHAR(50) NOT NULL,
Date_of_Manufacturing Date ,
Date_of_Expiration Date Not NULL,
Over_counter tinyint(1) default 0,
Price int,
company int,
constraint Pricecheck check (Price>0),
foreign key (company) references Company(Company_ID),
Primary Key(Serial_num)
);



create table Users(
User_ID INT NOT NULL ,
User_Name VARCHAR(50) NOT NULL,
User_Password VARCHAR(50) NOT NULL,
Age int(2) NOT NULL,
Phone_Num VARCHAR(11) NOT NULL,
primary key(User_ID),
constraint agecheck check (Age>18)
);


create table Doctor(
Doctor_ID INT NOT NULL ,
Doctor_Name VARCHAR(50) NOT NULL,
Age INT(2) check(age>=18),
Phone_Num VARCHAR(11) ,
Degree VARCHAR(50),
User_ID int,
foreign key(User_ID) references Users(User_ID),
primary key(Doctor_ID)
);



create table Employee(
Employee_ID INT NOT NULL,
Employee_Name VARCHAR(50) NOT NULL,
Age INT(2) NOT NULL,
Phone_Num VARCHAR(11) NOT NULL,
med int,
foreign key (med) references Medicine(Serial_Num),
primary key(Employee_ID),
constraint employeeage check(Age>20)
);


create table Location(
House_num int(10),
City VARCHAR(50) NOT NULL,
State VARCHAR(50) NOT NULL,
Pincode int(6),
primary key(Pincode)
);


create table Orders (
Order_ID INT NOT NULL ,
Order_Date datetime default now(),
medicine int,
user_n int,
pin int,
foreign key (medicine) references Medicine(Serial_Num),
foreign key (user_n) references Users(User_ID),
foreign key (pin) references Location(Pincode),
primary key(Order_ID)
);


create table Payment(
Payment_Mode INT NOT NULL ,
Transaction_ID VARCHAR(50) NOT NULL,
Amount VARCHAR(50) NOT NULL,
primary key(Transaction_ID)
);


